DROP TABLE IF EXISTS optical_nway_counterparts;
CREATE TABLE optical_nway_counterparts (
    ero_name VARCHAR(255),
    nway_bias_ls10_xray_proba DOUBLE,
    nway_dist_bayesfactor DOUBLE,
    nway_dist_post DOUBLE,
    nway_p_single DOUBLE,
    nway_p_any DOUBLE,
    nway_p_i DOUBLE,
    ls10_release INTEGER,
    ls10_brickid INTEGER,
    ls10_objid INTEGER,
    ls10_ra DOUBLE,
    ls10_dec DOUBLE,
    ls10_ra_ivar DOUBLE,
    ls10_dec_ivar DOUBLE,
    ls10_flux_g DOUBLE,
    ls10_flux_r DOUBLE,
    ls10_flux_i DOUBLE,
    ls10_flux_z DOUBLE,
    ls10_flux_w1 DOUBLE,
    ls10_flux_w2 DOUBLE,
    ls10_flux_ivar_g DOUBLE,
    ls10_flux_ivar_r DOUBLE,
    ls10_flux_ivar_i DOUBLE,
    ls10_flux_ivar_z DOUBLE,
    ls10_flux_ivar_w1 DOUBLE,
    ls10_flux_ivar_w2 DOUBLE,
    ls10_mw_transmission_g DOUBLE,
    ls10_mw_transmission_r DOUBLE,
    ls10_mw_transmission_i DOUBLE,
    ls10_mw_transmission_z DOUBLE,
    ls10_mw_transmission_w1 DOUBLE,
    ls10_mw_transmission_w2 DOUBLE,
    ls10_type VARCHAR(255),
    z_redshift DOUBLE,
    z_type VARCHAR(255),
    z_reference VARCHAR(255),
    PRIMARY KEY (ls10_ra, ls10_dec),
    FOREIGN KEY (ero_name) REFERENCES eroextra_master_erosita(ero_name),
    UNIQUE (ero_name)
);

